func TestSubarraySum(t *testing.T) {
	nums := []int{1, 1, 1}
	k := 2
	expect := 2
	if got := subarraySum(nums, k); got != expect {
		t.Errorf("subarraySum(%v, %v) = %v; expect %v", nums, k, got, expect)
	}
}

